import React, { useState, useEffect } from 'react';
import { dashboardAPI } from '../services/api';

function Dashboard() {
  const [dashboardData, setDashboardData] = useState(null);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);

  useEffect(() => {
    fetchDashboardData();
  }, []);

  const fetchDashboardData = async () => {
    try {
      setLoading(true);
      const response = await dashboardAPI.getOverview();
      setDashboardData(response.data);
      setError(null);
    } catch (err) {
      setError('Failed to load dashboard data');
      console.error('Dashboard error:', err);
    } finally {
      setLoading(false);
    }
  };

  if (loading) {
    return <div className="card">Loading dashboard...</div>;
  }

  if (error) {
    return <div className="alert alert-error">{error}</div>;
  }

  if (!dashboardData) {
    return <div className="card">No data available</div>;
  }

  return (
    <div>
      <h2>Dashboard Overview</h2>
      
      <div className="grid">
        <div className="stats-card">
          <div className="stats-number">{dashboardData.totalProducts}</div>
          <div>Total Products</div>
        </div>
        
        <div className="stats-card">
          <div className="stats-number">{dashboardData.totalSuppliers}</div>
          <div>Total Suppliers</div>
        </div>
        
        <div className="stats-card">
          <div className="stats-number">{dashboardData.totalTransactions}</div>
          <div>Total Transactions</div>
        </div>
        
        <div className="stats-card">
          <div className="stats-number">${dashboardData.totalInventoryValue}</div>
          <div>Total Inventory Value</div>
        </div>
      </div>

      <div className="card">
        <h3>Low Stock Alerts</h3>
        <div className="stats-card">
          <div className="stats-number">{dashboardData.lowStockProducts}</div>
          <div>Products Running Low</div>
        </div>
      </div>

      <div className="card">
        <h3>Recent Transactions</h3>
        {dashboardData.recentTransactions && dashboardData.recentTransactions.length > 0 ? (
          <table className="table">
            <thead>
              <tr>
                <th>Date</th>
                <th>Type</th>
                <th>Product</th>
                <th>Quantity</th>
                <th>Amount</th>
                <th>Customer/Supplier</th>
              </tr>
            </thead>
            <tbody>
              {dashboardData.recentTransactions.map((transaction) => (
                <tr key={transaction._id}>
                  <td>{new Date(transaction.transactionDate).toLocaleDateString()}</td>
                  <td>
                    <span style={{ 
                      color: transaction.transactionType === 'sale' ? 'green' : 'blue',
                      fontWeight: 'bold'
                    }}>
                      {transaction.transactionType.toUpperCase()}
                    </span>
                  </td>
                  <td>{transaction.productId?.productName || 'N/A'}</td>
                  <td>{transaction.transactionQuantity}</td>
                  <td>${transaction.totalAmount}</td>
                  <td>
                    {transaction.transactionType === 'sale' 
                      ? transaction.customerName 
                      : transaction.supplierId?.supplierName || 'N/A'
                    }
                  </td>
                </tr>
              ))}
            </tbody>
          </table>
        ) : (
          <p>No recent transactions</p>
        )}
      </div>
    </div>
  );
}

export default Dashboard;
